function generatePdf(dataobject) {
    const doc = new jsPDF();

    var pokeImagen = "data:image/png;base64,";
    
    doc.addImage(pokeImagen, "PNG", 5, 5, 25, 25);

    doc.setFontSize(24);

    doc.text("Banco Pokemon", 35, 25 );

    doc.setFontSize(12);
    
    //doc.fromHTML(document.getElementById(id), 20, 30);

    let firstline = 40;
    let nuevoTexto = ";"

    for (const [key, value] of Object.entries(dataobject)){
        nuevoTexto = `${key}: - $${value}`;
        doc.text(nuevoTexto, 20, firstline);
        firstline += 5;
    }

    doc.save('doc.pdf');
};